import{_ as p}from"./plugin-vue_export-helper-c27b6911.js";import{o as _,c as e,e as t}from"./app-f1e7afee.js";const o={},c=t("<p>《三命通会》卷 九·六庚日壬午时断</p><p>六庚日生时壬午，官印福宫聚食神；金士助身须显贵，日逢火旺命难通。</p><p>庚日壬午时，官印健旺。</p><p>庚以丁为官，己为印，壬为食。</p><p>午上壬食无气，丁巳禄旺。</p><p>通金土月气扶身者，贵。</p><p>通火气，官贵太重，反化为鬼；庚金柔弱，不能作福，运气扶身，亦贵。</p><p>庚子日壬午时，时日并冲，忧伤妻子。</p><p>通金气，贵。</p><p>火气，大贵，但多忧劳禄。</p><p>庚寅日壬午时，辰戌丑未巳申酉月，身旺，俱贵。</p><p>寅午，火旺，运气再遇，寿促；不然，残疾。</p><p>庚辰日壬午时，食神旺，善饮食，有操持，发即死。</p><p>庚午日壬午时，寅午戌月、金柔火旺，畏缩残疾。</p><p>亥子午月、行木火运，贵。</p><p>庚申日壬午时，禄马同乡，最吉。</p><p>如午未年月，位至台阁。</p><p>卯辰已，贵。</p><p>戌月、行火土运，清虚冷职。</p><p>庚戌日壬午时，卯月，正财，吉。</p><p>未月，杂气财官，贵。</p><p>辰丑月同。</p><p>壬庚会合临午，无破无冲福自来；从此名利皆有望，贵人举荐上天阶。</p><p>庚日时临壬午，支中官印俱藏。</p><p>贵人禄马更同乡，祸患潜消福长。</p><p>克破刑冲不吉，柱中更忌空亡。</p><p>将星天乙主荣昌，中暮家业兴旺。</p>",27),r=[c];function s(n,a){return _(),e("div",null,r)}const f=p(o,[["render",s],["__file","245卷 九·六庚日壬午时断.html.vue"]]);export{f as default};
